import React, {useState, useEffect} from "react";

function Projects(){

  const projectsApi = "http://127.0.0.1:8090/api/collections/projectts/records/";

  fetch(projectsApi)
  .then(response => {
    if(!response.ok){
      throw new Error('Failed to fetch data');
    }
    return response.json();
  })
  return
}

export default Projects;
